import React from 'react'

const reviews = [
     {
          user: ' Maria R.',
          review: "I just want to say thank you for providing college books at affordable prices. We all know not all, but most college students are on their own and have to work and study. By you selling books almost 50% off from what college book stores want, you help students like me, succeed and have a career. Thank you again.",
          rating: 5
     },
     {
          user: 'Paul T.',
          review: "Just wanted to say WELL DONE. First off, you all were the cheapest price for my book and I requested speedy delivery and it was at my door completely on time! Then you outdid yourselves! You sent me an email asking if I wanted to sell my books back. WOW! I was going to sell them locally to my school. Kudos! I have 2 more years of school left and you have made a VERY happy customer who will return!",
          rating: 4
     },
     {
          user: "Chris B.",
          review: "This read was engaging and quickly grabbed my attention from the first chapter.",
          rating: 3.5
     },
     {
          user: 'Jennie T.',
          review: "A quick note to let you know I rec'd my book -- great condition, fast shipping. Thanks so much! I'm happy to leave positive feedback. Thanks again.",
          rating: 4.5
     }
]

export default reviews;
